#[
                    %dw 2.0
                    output application/json
                    input payload application/xml
                    var baseUrl="http://sample.cloudhub.io/api/v1.0/"
                    ---
                    using (pageSize = payload.getItemsResponse.PageInfo.pageSize) {
                         links: [
                            {
                                href: fullUrl,
                                rel : "self"
                            }
                         ],
                         collection: {
                            size: pageSize,
                            items: payload.getItemsResponse.*Item map {
                                id: $.id,
                                type: $.type,
                                name: $.name
                            }
                         }
                    }
